			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "# 步骤:\n# 1. 在项目中添加Settings.bundle文件;\n# 2. 修改Settings.bundle的Root.plist列表;\n# 3. 编辑脚本，设置Settings.bundle的值;\n# 4. 项目中配置脚本, 路径:Target -> 项目名字 -> Build Phases, 点击左上角\"+\"号来增加\"Run Script\"一项, 并添加脚本代码.\n\n# 脚本的路径或键值有空格时不能简单写为:\"a b\", 而应写成: \"a\\ b\";\n# 如果使用了commit作为记录内容，那么在Git中没有办法用git ignore来隐藏变化，因为每个人编译时都会生成commit值，解决办法是用PlistBuddy脚本动态生成Root.plist文件.\n# Set :PreferenceSpecifiers:1:DefaultValue 中的数字1是根据该项键值对在Root.plist中的序号决定的.(在Xcode中查看plist文件，序号即是\"▶︎ Item 0\" 中Item后面的数字)\n\n\n# 1. 获取Version\nVersionIdentifier=$(/usr/libexec/PlistBuddy -c \"Print CFBundleShortVersionString\" \"${INFOPLIST_FILE}\")\n# 2. 获取Build Version\nBuildVersionIdentifier=$(/usr/libexec/PlistBuddy -c \"Print CFBundleVersion\" \"${INFOPLIST_FILE}\")\n# 3. 版本信息\nversionInfo=\"$VersionIdentifier($BuildVersionIdentifier)\"\n\n/usr/libexec/PlistBuddy -c \"Set :PreferenceSpecifiers:1:DefaultValue ${versionInfo}\" \"${PROJECT_DIR}/${PROJECT_NAME}/Supporting Files/Settings.bundle/Root.plist\"\n\n# 3. 获取Git当前commit SHA1值\n# GitCommitIdentifier=`git rev-parse --short HEAD | awk '{print $1}'`\n# /usr/libexec/PlistBuddy -c \"Set :PreferenceSpecifiers:4:DefaultValue ${GitCommitIdentifier}\" \"${PROJECT_DIR}/${PROJECT_NAME}/Supporting Files/Settings.bundle/Root.plist\"\n\n# 4. 获取Git当前分支\n# GitBranchIdentifier=`git rev-parse --abbrev-ref HEAD | awk '{print $1}'`\n# /usr/libexec/PlistBuddy -c \"Set :PreferenceSpecifiers:5:DefaultValue ${GitBranchIdentifier}\" \"${PROJECT_DIR}/${PROJECT_NAME}/Supporting Files/Settings.bundle/Root.plist\"\n\n";
		};
